import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the Trending navigation item to be visible
    await page.waitForSelector('a.nav-item[data-page="trending"]', { timeout: 5000 });

    // Click on the Trending navigation item
    await page.click('a.nav-item[data-page="trending"]');

    // Wait for the trending videos section to load
    await page.waitForSelector('.main-content'); // Assuming main content updates with trending videos

    // Take screenshot after clicking
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_click.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_click.png'));

    // Extract some data to verify task completion
    const trendingVideos = await page.evaluate(() => {
      return Array.from(document.querySelectorAll('.video-title')).map(video => video.textContent.trim());
    });

    return {
      success: true,
      action: "Clicked on the Trending navigation item and loaded trending videos",
      extractedData: { trendingVideos },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
